import React, { useState } from 'react';
import Card from './Card';
import { PropTypes } from 'prop-types';
import { getNodeText } from '@testing-library/react';



const CardList = (props) => {
    // const RenderCards = () => {
    //     var cards = [];
    //     for (let index = 0; index < cardNumbers.length; index++) {
    //         cards[index] = <Card key={index} number={cardNumbers[index]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide} />         
    //     }
    //     return cards;
    // }
    return (

        <div className="game-field">             
            <div className="row">                
                <Card number={props.cardNumbers[0]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide} />                                
                <Card number={props.cardNumbers[1]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
                <Card number={props.cardNumbers[2]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
                <Card number={props.cardNumbers[3]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
            </div>
            <div className="row">                
                <Card number={props.cardNumbers[4]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>                                
                <Card number={props.cardNumbers[5]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
                <Card number={props.cardNumbers[6]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
                <Card number={props.cardNumbers[7]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
            </div>
            <div className="row">                
                <Card number={props.cardNumbers[8]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>                                
                <Card number={props.cardNumbers[9]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
                <Card number={props.cardNumbers[10]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
                <Card number={props.cardNumbers[11]} onReveal={props.addToSelecteds} onHide={props.removeFromSelecteds} canHide={props.canHide}/>
            </div>
        </div>
        );
}

CardList.propTypes  = {    
    cardNumbers: PropTypes.array,
    addToSelecteds: PropTypes.func,
    removeFromSelecteds: PropTypes.func,
    canHide: PropTypes.func
}

export default CardList;
